import Link from "next/link";
import styled from "styled-components";
import Nav from "./Nav";

export default function Header() {
  return (
    <header>
      <div className="bar"></div>

      <Logo>
        <Link href="/">Sonic Archtecture</Link>
      </Logo>
      <div className="sub-bar">
        <p>Search</p>
      </div>
      <Nav />
    </header>
  );
}

const Logo = styled.h1`
  background: red;
  a {
    color: white;
  }
`;
